import React from 'react';
import {Button , Popconfirm} from 'antd';
export const columns = [
  {
    title: 'STT',
    dataIndex: 'stt',
    width: 100,
    fixed: 'left',
  },
  {
    title: 'Date',
    dataIndex: 'date',
    sorter: (a, b) => a.date - b.date,
    width: 100,
    fixed: 'left',
  },
  {
    title: 'Name',
    dataIndex: 'name',
    width: 150,
    fixed: 'left',
  },
  {
    title: 'Phone Customer',
    dataIndex: 'phoneCustomer',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'SHIP_METHOD',
    dataIndex: 'shipMethod',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'BOX_NO',
    dataIndex: 'boxNo',
    width: 150,
  },
  {
    title: 'PACKAGE_QTY',
    dataIndex: 'packageQuantity',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'ORDER_ITEM',
    dataIndex: 'orderItem',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'ITEM_DESCRIPTION_EN',
    dataIndex: 'itemDescriptionEN',
    ellipsis: true,
    width: 200,
  },
  {
    title: 'ITEM_DESCRIPTION',
    dataIndex: 'itemDescription',
    ellipsis: true,
    width: 350,
  },
  {
    title: 'ORDER_QUANTITY',
    dataIndex: 'orderQuantity',
    ellipsis: true,
    width: 150,
  },
  {
    title: 'UOM',
    dataIndex: 'uom',
    width: 150,
  },
  {
    title: 'ORDER_NET_WEIGHT',
    dataIndex: 'orderNetWeight',
    ellipsis: true,
    width: 250,
  },
  {
    title: 'ORDER_GROSS_WEIGHT',
    dataIndex: 'orderGrossWeight',
    ellipsis: true,
    width: 250,
  },
  {
    title: 'ITEM_FACTORY_COUNTRY',
    dataIndex: 'itemFactoryCountry',
    ellipsis: true,
    width: 250,
  },
  {
    title: 'AMOUNT',
    dataIndex: 'amount',
    width: 150,
  },
  {
    title: 'ORDER_CURR_CODE',
    dataIndex: 'orderCurrCode',
    ellipsis: true,
    width: 200,
  },
  {
    title: 'SHIP_FROM_PORT',
    dataIndex: 'shipFormPort',
    ellipsis: true,
    width: 200,
  },
  {
    title: 'SHIP_FROM_TO',
    dataIndex: 'shipFromTo',
    ellipsis: true,
    width: 150,
  },
  {
    title: "isComplete",
    dataIndex: "isComplete",
    key: "delete",
    ellipsis: true,
    width: 150,
    fixed: 'right',
    render: () => (

        <Popconfirm
          title="Are you sure Is Complete ?"
          okText="Yes"
          cancelText="No"
        >
          <Button type="primary">Complete</Button>
        </Popconfirm>

    )

  }
];

export default columns;
